 Centre - 0.9 km \/ 0.5 mi &lt;br \/&gt;Aliados Square - 0.9 km \/ 0.5 mi &lt;br \/&gt;Bom Sucesso Market - 0.9 km \/ 0.6 mi &lt;br \/&gt;Dom Pedro Monument - 0.9 km \/ 0.6 mi &lt;br \/&gt;&lt;\/p&gt;&lt;p&gt;The preferred airport for Rosa Et Al Townhouse is Porto (OPO-Dr. Francisco de Sa Carneiro) - 10.5 km \/ 6.5 mi. &lt;\/p&gt;","propertyDescription":"&lt;p&gt;&lt;b&gt;Property Location&lt;\/b&gt; &lt;br \/&gt;A stay at Rosa Et Al Townhouse places you in the heart of Porto, walking distance from Soares dos Reis National Museum and University of Porto.  This 5-star bed &amp; breakfast is within close proximity of Carmelitas Church and Crystal Palace Gardens.&lt;\/p&gt;&lt;p&gt;&lt;b&gt;Rooms&lt;\/b&gt; &lt;br \/&gt;Make yourself at home in one of the 6 individually decorated guestrooms, featuring refrigerators and iPod docking stations. Rooms have private balconies. Complimentary wireless Internet access keeps you connected, and cable programming is available for your entertainment. Private bathrooms with shower\/tub combinations feature deep soaking bathtubs and rainfall showerheads.&lt;\/p&gt;&lt;p&gt;&lt;b&gt;Rec, Spa, Premium Amenities&lt;\/b&gt; &lt;br \/&gt;Pamper yourself with a visit to the spa, which offers massages, body treatments, and facials. This bed &amp; breakfast also features complimentary wireless Internet access, concierge services, and babysitting\/childcare (surcharge).&lt;\/p&gt;&lt;p&gt;&lt;b&gt;Dining&lt;\/b&gt; &lt;br \/&gt;Grab a bite to eat at the bed &amp; breakfast&apos;s restaurant, where you can enjoy drinks at a bar and dine alfresco (weather permitting). Or stay in and take advantage of room service (during limited hours). Quench your thirst with your favorite drink at a bar\/lounge. Cooked-to-order breakfasts are available daily for a fee.&lt;\/p&gt;&lt;p&gt;&lt;b&gt;Business, Other Amenities&lt;\/b&gt; &lt;br \/&gt;Featured amenities include limo\/town car service, express check-in, and express check-out. Planning an event in Porto? This bed &amp; breakfast has facilities measuring 323 square feet (30 square meters), including a meeting room. A roundtrip airport shuttle and a train station pick-up service are provided for an additional charge.&lt;\/p&gt;","hotelPolicy":"You must present a photo ID when checking in. Your credit card is charged at the time you book. Bed type and smoking preferences are not guaranteed.Your reservation is prepaid and is guaranteed for late arrival. The total charge includes all room charges and taxes, as well as fees for access and booking. Any incidental charges such as parking, phone calls, and room service will be handled directly between you and the property.","roomInformation":"&lt;p&gt;&lt;b&gt;Know Before You Go&lt;\/b&gt; &lt;br \/&gt;&lt;ul&gt;  &lt;li&gt;This property offers transfers from the train station (surcharges may apply). Guests must contact the property with arrival details 48 hours prior to arrival, using the contact information on the booking confirmation. &lt;\/li&gt; &lt;li&gt;Reservations are required for massage services and spa treatments. Reservations can be made by contacting the bed &amp; breakfast prior to arrival, using the contact information on the booking confirmation. &lt;\/li&gt;&lt;li&gt;Only registered guests are allowed in the guestrooms. &lt;\/li&gt; &lt;li&gt;Guests can arrange to bring pets by contacting the property directly, using the contact information on the booking confirmation (surcharges apply and can be found in the Fees section). &lt;\/li&gt;  &lt;\/ul&gt;&lt;\/p&gt;&lt;p&gt;&lt;b&gt;Fees&lt;\/b&gt; &lt;br \/&gt;&lt;p&gt;The following fees and deposits are charged by the property at time of service, check-in, or check-out. &lt;\/p&gt; &lt;ul&gt; &lt;li&gt;Fee for cooked-to-order breakfast: EUR 15 per person (approximately)&lt;\/li&gt;    &lt;li&gt;Airport shuttle fee: EUR 15 per person (roundtrip)&lt;\/li&gt;  &lt;li&gt;Self parking fee: EUR 20 per night&lt;\/li&gt;  &lt;li&gt;Pet fee: EUR 35 per pet, per night&lt;\/li&gt;           &lt;li&gt;Crib (infant bed) fee: EUR 30 per night&lt;\/li&gt;&lt;li&gt;Rollaway beds are available for an additional fee&lt;\/li&gt;  &lt;\/ul&gt; &lt;p&gt;The above list may not be comprehensive. Fees and deposits may not include tax and are subject to change. &lt;\/p&gt;&lt;\/p&gt;","drivingDirections":"","checkInInstructions":"Extra-person charges may apply and vary depending on hotel policy. <br \/>Government-issued photo identification and a credit card or cash deposit are required at check-in for incidental charges. <br \/>Special requests are subject to availability upon check-in and may incur additional charges. Special requests cannot be guaranteed.  <ul><li>The name on the credit card used at check-in to pay for incidentals must be the primary name on the guestroom reservation. <\/li><\/ul>","knowBeforeYouGoDescription":"<ul>  <li>This property offers transfers from the train station (surcharges may apply). Guests must contact the property with arrival details 48 hours prior to arrival, using the contact information on the booking confirmation. <\/li> <li>Reservations are required for massage services and spa treatments. Reservations can be made by contacting the bed & breakfast prior to arrival, using the contact information on the booking confirmation. <\/li><li>Only registered guests are allowed in the guestrooms. <\/li> <li>Guests can arrange to bring pets by contacting the property directly, using the contact information on the booking confirmation (surcharges apply and can be found in the Fees section). <\/li>  <\/ul>","roomFeesDescription":"<p>The following fees and deposits are charged by the property at time of service, check-in, or check-out. <\/p> <ul> <li>Fee for cooked-to-order breakfast: EUR 15 per person (approximately)<\/li>    <li>Airport shuttle fee: EUR 15 per person (roundtrip)<\/li>  <li>Self parking fee: EUR 20 per night<\/li>  <li>Pet fee: EUR 35 per pet, per night<\/li>           <li>Crib (infant bed) fee: 